webpackJsonp([94169572598175],{678:function(t,e){t.exports={data:{wordpressPost:{title:"Most read articles in November",content:'<p>The most read BMJ Open article in November was Margel and Fleshner&#8217;s ecological study of the association between oral contraceptive use and prostate cancer. The paper received lots of press attention, with articles in the <a href="http://www.bbc.co.uk/news/health-15720478">UK</a>, <a href="http://www.hindustantimes.com/Lifestyle/Wellness/Contraceptive-pill-use-causes-prostate-cancer/Article1-769441.aspx">India</a>, <a href="http://www.vancouversun.com/health/Prostate+cancer+linked+birth+control+pills+Study/5709747/story.html">Canada</a> and the <a href="http://www.foxnews.com/health/2011/11/15/prostate-cancer-may-be-linked-to-birth-control-pills-in-water-supply/">US</a>.</p>\n<p>Brett <em>et al</em>&#8216;s paper on effective communication with parents of pre-term infants was also popular last month, going from 9th most viewed in October up to 2nd place in November. Overgaard <em>et al</em>&#8216;s study of midwifery units also remained highly viewed.</p>\n<table border="1" cellspacing="0" cellpadding="0" width="483">\n<tbody>\n<tr>\n<td width="50" valign="top">Rank</td>\n<td width="132" valign="top">Author(s)</td>\n<td width="301" valign="top">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Margel &amp; Fleshner</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000311.full">Oral contraceptive use is associated with prostate cancer: an ecological study</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Brett et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/1/e000023.full?sid=4cab8712-aa8b-4a56-a3c9-e082c5146a70">A systematic mapping review of effective interventions for communicating with, supporting and providing information to parents of preterm infants</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Overgaard et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000262.full?sid=dabb201b-0b11-4a8e-b6fe-59ff6553f856">Freestanding midwifery unit versus obstetric unit: a matched cohort study of outcomes in low-risk women</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Scarborough et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/1/e000263.full">Differences in coronary heart disease, stroke and cancer mortality rates between England, Wales, Scotland and Northern Ireland: the role of diet and nutrition</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Laxminarayan &amp; Klugman</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000135.abstract">Communicating trends in resistance using a drug resistance index</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Lee et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000269.full?sid=cb490a28-a3b0-49b7-91d8-c1d9723dfc1c">UK stroke incidence, mortality and cardiovascular risk management 1999–2008: time-trend analysis from the General Practice Research Database</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Holden et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000258.full?sid=36310af1-24d0-4474-ae8f-985a26f3fce7">Evaluation of the incremental cost to the National Health Service of prescribing analogue insulin</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Rodriguez-Llanes et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000109.full.pdf">Child malnutrition and recurrent flooding in rural eastern India: a community-based survey</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Roberts et al</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/early/2011/05/24/bmjopen-2011-000101.full.pdf">Population-based trends in pregnancy hypertension and pre-eclampsia: an international comparative study</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Apler</td>\n<td width="301" valign="top"><a href="http://bmjopen.bmj.com/content/1/2/e000106.full?sid=379aef75-06fd-47a6-a1a9-ae301660c64d">Citalopram for major depressive disorder in adults: a systematic review and meta-analysis of published placebo-controlled trials</a></td>\n</tr>\n</tbody>\n</table>\n<p>Click on the titles to view the articles in full.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"44a7c33c-72ee-553d-adcc-ff9141dc8fb4"}}}});
